webpackJsonp([59921319215614],{369:function(E,i){E.exports={pathContext:{page:{fileAbsolutePath:"/Users/smoclock/key/cdn-docs/src/docs/000-config/007-7.md",html:'<p>当CDN节点回源请求源站返回301/302状态码时，CDN 节点会直接向跳转地址请求资源而不返回 302 给用户。</p>\n<h3 id="配置指引"><a href="#%E9%85%8D%E7%BD%AE%E6%8C%87%E5%BC%95" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>配置指引</h3>\n<ol>\n<li>\n<p>登录控制台，在左侧菜单栏域名管理内选择【域名配置】，选择域名，再选择【添加配置】。点击【添加配置】，选择【缓存】内的添加【继续跳转后的内容】</p>\n<p><img src="/image/image-20181120170812094.png" alt="image-20181120170812094"></p>\n<p><img src="/image/image-20181120170904316.png" alt="image-20181120170904316"></p>\n<p><img src="/image/image-20181120170933660.png" alt="image-20181120170933660"></p>\n</li>\n<li>\n<p>配置添加完成后点击【请点击发布】，再【确认保存】，配置即可生效。</p>\n<p><img src="/image/image-20181121100524303.png" alt="image-20181121100524303"></p>\n<p><img src="/image/image-20181121100545975.png" alt="image-20181121100545975"></p>\n<p><img src="/image/image-20181121100639754.png" alt="image-20181121100639754"></p>\n</li>\n<li>\n<p>配置参数含义</p>\n<ul>\n<li>跳转状态码：如果源站返回的是301状态码，则勾选301，如果源站返回状态码为302，则勾选302。两种状态码可同时选择不冲突。</li>\n</ul>\n</li>\n</ol>\n<h3 id="配置案例"><a href="#%E9%85%8D%E7%BD%AE%E6%A1%88%E4%BE%8B" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>配置案例</h3>\n<p>域名Blog4.lowxp.com 获取302后的内容</p>\n<p><img src="/image/image-20181121102447504.png" alt="image-20181121102447504"></p>\n<p>用户A请求<a href="http://Blog4.lowxp.com/abc/1.jpg%EF%BC%8C%E8%8A%82%E7%82%B9%E6%9C%AA%E7%BC%93%E5%AD%98%E5%91%BD%E4%B8%AD%EF%BC%8C%E5%88%99%E8%8A%82%E7%82%B9%E5%9B%9E%E6%BA%90%E8%AF%B7%E6%B1%82%E8%AF%A5%E8%B5%84%E6%BA%90%EF%BC%8C%E8%8B%A5%E6%BA%90%E7%AB%99%E8%BF%94%E5%9B%9E%E7%9A%84%E7%8A%B6%E6%80%81%E7%A0%81%E4%B8%BA302%EF%BC%8C%E8%B7%B3%E8%BD%AC%E5%90%8E%E6%8C%87%E5%90%91%E5%9C%B0%E5%9D%80">http://Blog4.lowxp.com/abc/1.jpg，节点未缓存命中，则节点回源请求该资源，若源站返回的状态码为302，跳转后指向地址</a> <a href="http://www.test.com/1.jpg%EF%BC%8C%E5%A6%82%E6%9E%9C%E9%85%8D%E7%BD%AE%E4%BA%86%E3%80%90%E7%BB%A7%E7%BB%AD%E8%B7%B3%E8%BD%AC%E5%90%8E%E7%9A%84%E5%86%85%E5%AE%B9%E3%80%91%EF%BC%8C%E5%88%99%EF%BC%9A">http://www.test.com/1.jpg，如果配置了【继续跳转后的内容】，则：</a></p>\n<ol>\n<li>节点会继续向跳转后的地址发起请求。</li>\n<li>获取到所需资源后，缓存到节点，返回给客户，并根据Blog4.lowxp.com域名的缓存规则进行缓存。</li>\n<li>用户B向<a href="http://Blog4.lowxp.com/abc/1.jpg%EF%BC%8C%E5%88%99%E4%BC%9A%E5%9C%A8%E8%8A%82%E7%82%B9%E5%91%BD%E4%B8%AD%E7%9B%B4%E6%8E%A5%E8%BF%94%E5%9B%9E%E7%BB%99%E7%94%A8%E6%88%B7%E3%80%82">http://Blog4.lowxp.com/abc/1.jpg，则会在节点命中直接返回给用户。</a></li>\n</ol>\n<p>如果没有配置【继续跳转后的内容】，则：</p>\n<ol>\n<li>节点将302响应直接给用户</li>\n<li>用户再向 <a href="http://www.test.com/1.jpg%E5%8F%91%E8%B5%B7%E8%AF%B7%E6%B1%82%E3%80%82">http://www.test.com/1.jpg发起请求。</a></li>\n<li>用户B也向<a href="http://Blog4.lowxp.com/abc/1.jpg%E5%8F%91%E8%B5%B7%E8%AF%B7%E6%B1%82%E6%97%B6%EF%BC%8C%E5%88%99%E4%BC%9A%E9%87%8D%E5%A4%8D%E4%B8%8A%E8%BF%B0%E6%B5%81%E7%A8%8B%E3%80%82">http://Blog4.lowxp.com/abc/1.jpg发起请求时，则会重复上述流程。</a></li>\n</ol>',headings:[{value:"配置指引",depth:3},{value:"配置案例",depth:3}],frontmatter:{title:"跟随301/302跳转",parent:"/Users/smoclock/key/cdn-docs/src/docs/000-config/007-7.md absPath of file"}},nav:[{title:"用户指南",children:[{title:"源站配置",path:"/docs/config/1"},{title:"回源HOST",path:"/docs/config/2"},{title:"缓存规则",path:"/docs/config/3"},{title:"IP黑名单",path:"/docs/config/4"},{title:"Referer黑白名单",path:"/docs/config/5"},{title:"HTTP头配置",path:"/docs/config/6"},{title:"跟随301/302跳转",path:"/docs/config/7"},{title:"限速规则",path:"/docs/config/8"}],redirectFrom:"/docs/config",path:"/docs/config/1"}]}}}});
